import Layout from "../components/Layout";

import { Carousel } from "antd";


const Index = () => {
  return (
    <Layout>
      <div>
        <h2 className="text-center">Home Page</h2>
        <Carousel autoplay>
          <div>
            <h3>
              <img src="" id="one"/>
            </h3>
          </div>
          <div>
            <h3>
              <img id="two" />
            </h3>
          </div>
          <div>
            <h3>
              <img id="three" />
            </h3>
          </div>
        </Carousel>
      </div>
    </Layout>
  );
};

export default Index;
